import React, { Component } from "react";

export default class CreateUser extends Component {
  constructor(props) {
    super(props);
    this.onChangeUsername = this.onChangeUsername.bing(this);

    this.state = {
      username: ""
    };
  }

  componentDidMount() {
    this.setState({
      username: "Pikachu"
    });
  }

  onChangeUsername(e) {
    this.setState({
      username: e.target.value
    });
  }
  onSubmit(e) {
    e.preventDfault();
